    let navigate = useNavigate();

    const onLogOutClick = () => {
        authService.signOut()
        navigate("/")
    };

    const getMyNweets = async () => {
        const nweets = await dbService
                .collection("nweets")
                .where("creatorId", "==", userObj.uid)
                .orderBy("createdAt", "asc")
                .get();
